import HomePage from "./Page/Home/HomePage";
import { BrowserRouter ,  Routes , Route} from "react-router-dom";

function App() {
  return (
    <div className="font">
      <BrowserRouter>
        <Routes>
          <Route path="" element={ <HomePage/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
